import React from "react";
import Logo from "../../assets/images/logo/logo.png";
import LogoAlt from "../../assets/images/logo/logo-alt.png";
const logo = ({ alt }) => {
	return (
		<div>
			<img src={!alt ? Logo : LogoAlt} alt="logo" />
		</div>
	);
};

export default logo;
